import React from "react";
import { Link, useParams } from "react-router-dom";

export default function Category() {
  const { filter } = useParams();
  console.log(filter);
  return (
    <div>
      <h1>Category {filter}</h1>
      import ReactPlayer from 'react-player/youtube'
    </div>
  );
}
